social_posts.post_text:
just to be near the king. 😭 my heart longs to know Him deeper, drawn to His gentle + lowly heart for me. for you. 

the delight found sinking deeper into His love. He brought me to this place. to these women. calling me deeper into relationship with Him. giving me fresh perspective on friendship + sisterhood, in which I feel most of my life I have struggled. in + through His kindness, He made a way for me to be here + held me close as I open my heart to these women + Himself. 

@kaleoretreats you have blessed me. you gave me a space to rest. to be who I am. to be known and loved. + I know the women to come, will be forever changed. my heart is simply overwhelmed.
